  const history = useHistory()
  const eventlist = (id1) =>{
    let enable = 0
    window.setTimeout(function() {
    let el2 = document.getElementById(`themes_${id1}`)
    if(el2){
      el2.addEventListener('click', () =>{
          history.push(THEME_ROUTE + `/${id1}`)
          console.log(id1)
      });
    }
  }, 500);}

  return (
    <div id={`themes_${themes.id}`}className="programms">
      {themes.name}
      {eventlist(themes.id)}
    </div>
  )
}
